export function Person(name, player, level, clazz, race, killStats) {
    this.name = name;
    this.player = player;
    this.level = level;
    this.clazz = clazz;
    this.race = race;
    this.killStats = killStats;

    Object.defineProperty(this, "totalKills", {
        get: function () {
            return this.killStats.reduce((accumulator, current) =>
                accumulator + current.count, 0)
        }
    });
}

function People(firstName, lastName) {
    this.firstName = firstName;
    this.lastName = lastName;

    Object.defineProperty(this, 'fullName', {
        get: function() {
            return this.firstName + ' ' + this.lastName;
        }
    });
}

const person = new People('John', 'Doe');
console.log(person.fullName); // Output: John Doe

